def TempPolyFitFunc(x, b, m, sh, t1):
   heat_loss =  b[0]*np.power(x, b[1])
   t2 =  t1+(heat_loss/(m*sh))
   return t2

def TempLineFitFunc(x, w0, m, sh, t1):
	heat_loss =  x*w0
	t2 =  t1+(heat_loss/(m*sh))
	return t2

def TempExpnFitFunc(x, w, m, sh, t1 ):
	heat_loss = w[0]*np.exp(w[1]*x)+w[2]
	t2 =  t1+(heat_loss/(m*sh))
	return t2

